def extract_seed_from_url(url: str) -> int | None:
    from urllib.parse import parse_qs, urlparse
    try:
        parsed = urlparse(url)
        query = parse_qs(parsed.query)
        if query.get("seed"):
            value = int(str(query["seed"][0]).strip())
            return value
    except Exception:
        return None

